import React from 'react';
import { WiDayCloudyGusts } from "react-icons/wi";

function Navbar({handleLogoClick}) {

    const handleNavClick = () => {
        handleLogoClick();
    };

    return (
        <div className="cursor-pointer flex flex-row items-center justify-between font-mono text-stone-200 bg-header-primary text-sm md:text-md
         xl:text-2xl p-2 2xl:text-4xl" onClick={handleNavClick}>
            <div className='flex flex-row justify-between items-center p-1 mx-auto md:mx-0'>
                <WiDayCloudyGusts size={60} className="animate-pulse ease-in-out" />
                <span className='font-semibold tracking-wider'>&nbsp;Daily Weather</span>
            </div>
            <div className="hidden text-center cursor-pointer tracking-tighter p-1 md:block">
                {new Date().toDateString()}
            </div>
        </div>
    )
}

export default Navbar
